import React from 'react';
import { Route } from 'react-router-dom';
import './App.css';
import NavBar from './Components/NavBar'
import Home from './Components/Home'
import ToDo from './Components/Todo'

const App = (props) => {
  return (
    <div>
      <NavBar />
      <Route exact path="/" component={Home} />
    </div>
  )

}


export default App;
